import React, { Component } from "react";
import axios from "axios";
import { apiHost } from "../utils/restAPI";

class Home extends Component {
  state = {
    videos: []
  };

  componentDidMount = () => {
    let data = {};

    // Send a GET request
    axios
      .get(apiHost + "/api/videos")
      .then(response => {
        data = response.data;

        this.setState({
          videos: data
        });
      })
      .catch(function(error) {
        // handle error
        console.log(error);
      });
  };

  render() {
    const { videos } = this.state;
    return (
      <ul className="list-group">
        {videos.map(video => (
          <li className="list-group-item">{video}</li>
        ))}
      </ul>
    );
  }
}

export default Home;
